import React, { Component } from 'react';
import './Blayout.css'

class Blayout extends  Component {

    	state = {
    		items: this.props.items || []
    	}


    render() {
    	const items  = this.state.items;
    	return<div>
               	{
               		items.map(item => <div key = {item.id}>
               				{
               					item.value
               				}
               			</div>
               		)
               	}
               </div>


    }


}


export default Blayout;
